import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import authService from "../../services/authService";
import userService from "../../services/userService";

const Login = () => {
  const navigate = useNavigate();
  const [form, setForm] = useState({
    email: "",
    password: "",
  });

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const res = await authService.login(form);
      console.log("‚úÖ LOGIN RESULT:", res);
      console.log("‚úÖ LOGIN DATA:", res.data);

      // ‚úÖ DEBUG CHI TI·∫æT: Ki·ªÉm tra to√†n b·ªô response
      console.log("üîç FULL RESPONSE STRUCTURE:", JSON.stringify(res.data, null, 2));

      const loginData = res.data;

      let userId;
      let userToStore = {};

      // ‚úÖ T√åM USER_ID - TH√äM NHI·ªÄU TR∆Ø·ªúNG H·ª¢P H∆†N
      if (loginData.id) {
        userId = loginData.id;
        console.log("üîç Found id:", userId);
      } else if (loginData.user_id) {
        userId = loginData.user_id;
        console.log("üîç Found user_id:", userId);
      } else if (loginData.userId) {
        userId = loginData.userId;
        console.log("üîç Found userId:", userId);
      } else if (loginData.user) {
        console.log("üîç Found user object:", loginData.user);
        if (loginData.user.id) {
          userId = loginData.user.id;
          console.log("üîç Found user.id:", userId);
        } else if (loginData.user.user_id) {
          userId = loginData.user.user_id;
          console.log("üîç Found user.user_id:", userId);
        } else if (loginData.user.userId) {
          userId = loginData.user.userId;
          console.log("üîç Found user.userId:", userId);
        }
      }

      console.log("üîç Final userId:", userId);

      // ‚úÖ N·∫æU C√ì USER_ID TH·∫¨T, G·ªåI API USER
      if (userId && !userId.toString().includes('temp_')) {
        try {
          console.log("üîÑ Fetching user profile for userId:", userId);
          const userProfile = await userService.getUserProfile(userId);
          console.log("‚úÖ User profile received:", userProfile);

          userToStore = {
            userId: userId,
            email: userProfile.email || form.email,
            first_name: userProfile.firstName || userProfile.first_name || "User", // ‚úÖ Default "User"
            last_name: userProfile.lastName || userProfile.last_name || ""
          };

        } catch (profileError) {
          console.error("‚ùå Error fetching user profile:", profileError);
          // Fallback v·ªõi first_name m·∫∑c ƒë·ªãnh
          userToStore = {
            userId: userId,
            email: form.email,
            first_name: "User", // ‚úÖ Default first_name
            last_name: ""
          };
        }
      } else {
        // ‚úÖ N·∫æU KH√îNG C√ì USER_ID TH·∫¨T, T·∫†O USER V·ªöI FIRST_NAME T·ª™ EMAIL
        console.warn("‚ö†Ô∏è No real userId, creating user with first_name from email");
        const emailName = form.email.split('@')[0]; // L·∫•y t√™n t·ª´ email
        userToStore = {
          userId: `temp_${Date.now()}`,
          email: form.email,
          first_name: emailName || "User", // ‚úÖ D√πng t√™n t·ª´ email
          last_name: ""
        };
      }

      // ‚úÖ L∆∞u v√†o localStorage
      console.log("üíæ Saving user to localStorage:", userToStore);
      localStorage.setItem("user", JSON.stringify(userToStore));

      // ‚úÖ L∆∞u token n·∫øu c√≥
      if (loginData.token) {
        localStorage.setItem("token", loginData.token);
        console.log("üîë Token saved");
      }

      alert("‚úÖ ƒêƒÉng nh·∫≠p th√†nh c√¥ng!");
      window.location.href = "/";

    } catch (err) {
      console.error("‚ùå LOGIN ERROR:", err);
      alert("‚ùå ƒêƒÉng nh·∫≠p th·∫•t b·∫°i!");
    }
  };

  return (
    <div className="card mx-auto" style={{ maxWidth: "380px", marginTop: "100px" }}>
      <div className="card-body">
        <h4 className="card-title mb-4">Sign in</h4>

        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <input
              name="email"
              className="form-control"
              placeholder="Email"
              type="email"
              value={form.email}
              onChange={handleChange}
              required
            />
          </div>

          <div className="form-group">
            <input
              name="password"
              className="form-control"
              placeholder="Password"
              type="password"
              value={form.password}
              onChange={handleChange}
              required
            />
          </div>

          <button type="submit" className="btn btn-primary btn-block">
            Login
          </button>
        </form>
      </div>
    </div>
  );
};

export default Login;
